import React from 'react';
import { CssBaseline } from '@mui/material';
import Navbar from '.components/Navbar';
import DataList from '.components/DataList';

function App() {
  return (
    <div>
      <CssBaseline /> {/* Resetuje CSS pro konzistentn√≠ vzhled */}
      <Navbar />
      <DataList />
    </div>
  );
}

export default App;
